INSERT  IGNORE INTO `group_news` VALUES (1,'Scouting supports those living with cancer','As we mark World Cancer Day, we recognise the supportive environment scout groups can provide to members dealing with the effects of the disease.','0000-00-00 00:00:00','http://www.scouts.org.uk/news/468/scouting-supports-those-living-with-cancer','http://www.scouts.org.uk/news/468/scouting-supports-those-living-with-cancer',103),(2,'Prince Charles meets scouts to tackle youth issues','Prince Charles met scouts in Lewisham to discuss action on the issues affecting young people in some of the UK\'s hardest-hit areas.','0000-00-00 00:00:00','http://www.scouts.org.uk/news/467/prince-charles-meets-scouts-to-tackle-youth-issues','http://www.scouts.org.uk/news/467/prince-charles-meets-scouts-to-tackle-youth-issues',103),(3,'Scout enters Antarctic record books','Scout Bryony Balen is the youngest Briton to ski to the South Pole, tackling hostile conditions to reach her goal in the centenary year of Scott\'s expedition.','0000-00-00 00:00:00','http://www.scouts.org.uk/news/466/scout-enters-antarctic-record-books','http://www.scouts.org.uk/news/466/scout-enters-antarctic-record-books',103),(4,'Sun shines on Scouting\'s winter adventure','Nearly 3,000 Scouts and 850 adult volunteers made the most of the unusually mild weekend as they climbed, off-roaded and even ice skated at Gilwell Park\'s Wintercamp.','0000-00-00 00:00:00','http://www.scouts.org.uk/news/465/sun-shines-on-scoutings-winter-adventure','http://www.scouts.org.uk/news/465/sun-shines-on-scoutings-winter-adventure',103),(5,'Scouts all set for Wintercamp mudfest','3,000 scouts from across the UK are preparing for a muddy and gusty Wintercamp at Gilwell Park Scout Activity Centre.','0000-00-00 00:00:00','http://www.scouts.org.uk/news/464/scouts-all-set-for-wintercamp-mudfest','http://www.scouts.org.uk/news/464/scouts-all-set-for-wintercamp-mudfest',103),(6,'Scouting welcomes royal volunteer','HRH The Duchess of Cambridge has become Scouting\'s newest volunteer and will help at local cub packs and beaver colonies, Clarence House has announced.','0000-00-00 00:00:00','http://www.scouts.org.uk/news/463/scouting-welcomes-royal-volunteer','http://www.scouts.org.uk/news/463/scouting-welcomes-royal-volunteer',103),(7,'Taking Christmas to Kenya','Christmas in Africa has become a reality to 50 Scouts and their leaders from south-east London.','0000-00-00 00:00:00','http://www.scouts.org.uk/news/462/taking-christmas-to-kenya','http://www.scouts.org.uk/news/462/taking-christmas-to-kenya',103),(8,'Cub Scout saves grandfather\'s life','First aid skills learned in Scouting come to the rescue','0000-00-00 00:00:00','http://www.scouts.org.uk/news/461/cub-scout-saves-grandfathers-life','http://www.scouts.org.uk/news/461/cub-scout-saves-grandfathers-life',103),(9,'Scouting skills in the jungle','Cub Leader draws on his Scouting experience on a trek through Borneo','0000-00-00 00:00:00','http://www.scouts.org.uk/news/460/scouting-skills-in-the-jungle','http://www.scouts.org.uk/news/460/scouting-skills-in-the-jungle',103),(10,'Scouts prove they are digital champions','Scouts across the UK are continuing to lead the way in Race Online 2012','0000-00-00 00:00:00','http://www.scouts.org.uk/news/459/scouts-prove-they-are-digital-champions','http://www.scouts.org.uk/news/459/scouts-prove-they-are-digital-champions',103),(11,'Scouting volunteer on epic journey','One Scout leader is walking and swimming from Hertfordshire to Morocco','0000-00-00 00:00:00','http://www.scouts.org.uk/news/458/scouting-volunteer-on-epic-journey','http://www.scouts.org.uk/news/458/scouting-volunteer-on-epic-journey',103),(12,'Scouts question policy makers in Winchester','One Explorer Scout tells us about his day at Scouts\' Question Time','0000-00-00 00:00:00','http://www.scouts.org.uk/news/457/scouts-question-policy-makers-in-winchester','http://www.scouts.org.uk/news/457/scouts-question-policy-makers-in-winchester',103),(13,'Chief Scout takes to the skies to visit thousands of Scouts','Scouts in the east Midlands turned out in force on Saturday to welcome Bear Grylls, who travelled by helicopter to five events and encouraged Scouts to live out their dreams.','0000-00-00 00:00:00','http://www.scouts.org.uk/news/456/chief-scout-takes-to-the-skies-to-visit-thousands-of-scouts','http://www.scouts.org.uk/news/456/chief-scout-takes-to-the-skies-to-visit-thousands-of-scouts',103),(14,'Old Basing Scouts hopeful of funding for new hall eco-dream','An eco-friendly project to rebuild the Scout and Guide hall in Old Basing, Hampshire, has reached the final round of voting for Energyshare funding.','0000-00-00 00:00:00','http://www.scouts.org.uk/news/455/old-basing-scouts-hopeful-of-funding-for-new-hall-ecodream','http://www.scouts.org.uk/news/455/old-basing-scouts-hopeful-of-funding-for-new-hall-ecodream',103),(15,'Scouts join nation in Remembrance Day activities','As the nation falls silent to remember the sacrifice of those lost to two world wars and conflicts since, Scouts are serving their communities to join in the tributes.','0000-00-00 00:00:00','http://www.scouts.org.uk/news/454/scouts-join-nation-in-remembrance-day-activities','http://www.scouts.org.uk/news/454/scouts-join-nation-in-remembrance-day-activities',103),(16,'Scouts help family in mountain difficulty','Trainee Scout leaders used their mountain skills to bring a local family to safety in the Lake District','0000-00-00 00:00:00','http://www.scouts.org.uk/news/453/scouts-help-family-in-mountain-difficulty','http://www.scouts.org.uk/news/453/scouts-help-family-in-mountain-difficulty',103),(17,'Explorer and Network 10th Birthday Badge','We\'re celebrating 2012 with a special occasional badge, as voted for by Members','0000-00-00 00:00:00','http://www.scouts.org.uk/news/452/explorer-and-network-10th-birthday-badge','http://www.scouts.org.uk/news/452/explorer-and-network-10th-birthday-badge',103),(18,'Corporate and events experts praise Gilwell 